void Dbg_dl_iphdr_callback ( Lm_list * lml , struct dl_phdr_info * info ) { dbg_print ( lml , MSG_INTL ( MSG_DL_IPHDR_CALLBACK ) ) ; dbg_print ( lml , MSG_INTL ( MSG_DL_IPHDR_NAME ) , info -> dlpi_name ) ; dbg_print ( lml , MSG_INTL ( MSG_DL_IPHDR_ADDR ) , EC_ADDR ( info -> dlpi_addr ) ) ; dbg_print ( lml , MSG_INTL ( MSG_DL_IPHDR_PHDR ) , EC_ADDR ( CAST_PTRINT ( Addr , info -> dlpi_phdr ) ) , EC_WORD ( info -> dlpi_phnum ) ) ; } 